static void
g_signal (GDBusProxy  *proxy,
          const gchar *sender_name,
          const gchar *signal_name,
          GVariant    *parameters)
{
  guint signal_id;
  signal_id = lookup_signal_id_from_signal_name (signal_name);
  switch (signal_id)
    {
    case __AUTH_REQUIRED_SIGNAL:
      {
        g_signal_emit (proxy,
                       signals[signal_id],
                       0);
      }
      break;

    case __BACKEND_ERROR_SIGNAL:
      {
        const gchar *arg_error;
        g_variant_get (parameters,
                       "(&s)",
                       &arg_error);
        g_signal_emit (proxy,
                       signals[signal_id],
                       0, arg_error);
      }
      break;

    case __READONLY_SIGNAL:
      {
        gboolean arg_is_readonly;
        g_variant_get (parameters,
                       "(b)",
                       &arg_is_readonly);
        g_signal_emit (proxy,
                       signals[signal_id],
                       0, arg_is_readonly);
      }
      break;

    case __MODE_SIGNAL:
      {
        gint arg_mode;
        g_variant_get (parameters,
                       "(i)",
                       &arg_mode);
        g_signal_emit (proxy,
                       signals[signal_id],
                       0, arg_mode);
      }
      break;

    }
}

